{'name': {'type': 'string', 'description': 'Shred, Ed. 3 of 7'}, 'description': {'type': 'string', 'description': "From the origins of collecting, the notion of property always came accompanied by a tangible, unique and unrepeatable object. In contemporary times, and even more since the peak of NFTs, the value isn't located in the physical artwork -as the original is infinitely reproducible without loss of quality-, but in the notion of the certified possession. We are attending to the total dematerialization of art, a paradigmatic turning point in history that radically changes how we understand material culture and archiving. 

This evolution of the artistic object has stimulated the appearance of new ways of market value, like the NFTs, a phenomena that we have followed closely and on which we've wanted to reflect with 'Shred'.

'Shred' is a generative animation that uses NFTs as raw material. The algorithm that activates the dynamic content of the screen -custom designed by the studio- captures in real time thousands of NFTs that are being uploaded to e-commerce platforms. It then shreds the images into rows of pixels, and like in a loom, weaves the rows together into new configurations. This ceaseless activity of the artwork evokes the incessant and indefatigable fever of digital collecting."}, 'image': {'type': 'string', 'description': 'https://monegraph.mypinata.cloud/ipfs/QmcYJgMh5FznEfJ7ZqjtrDwAJPAMxLnd2F9PT4ND4n9nUc/DanielCanogar-Shred-Ed3of7-4K_OpenSea.png'}, 'rights_agreement': {'type': 'string', 'description': 'https://ipfs.io/ipfs/QmXnGrZdiarcURqbgw1QUveCWt3Resu2rhoX67kxu1NMbC'}, 'rights_agreement_signature_type': {'type': 'string', 'description': 'SHA-256'}, 'rights_agreement_signature': {'type': 'string', 'description': '5085a00871feb30ffc3f1380578d1ccb993c307400950b5f582b90e9b8222dba'}, 'archive_link': {'type': 'string', 'description': 'https://monegraph.mypinata.cloud/ipfs/ed3of7.shred.danielcanogar.com'}, 'archive_link_signature_type': {'type': 'string', 'description': 'SHA-256'}, 'archive_link_signature': {'type': 'string', 'description': 'fc1b29f18af378eac76eb21c1250697e6c9e2110538da7f1daaafc7a35b55453'}, 'rights_agreement_values': {'$ARTIST': 'Daniel Canogar', '$SHAHASH': 'fc1b29f18af378eac76eb21c1250697e6c9e2110538da7f1daaafc7a35b55453', '$URL': 'https://monegraph.mypinata.cloud/ipfs/QmcYJgMh5FznEfJ7ZqjtrDwAJPAMxLnd2F9PT4ND4n9nUc/DanielCanogar-Shred-Ed3of7-4K_OpenSea.png', '$TITLE': 'Shred, Ed. 3 of 7', '$YEAR': '2021', '$ROYALTYRATE': '10', '$ADDRESS': '0x89D274b8151Ce8B2Ce2B5866EaDb331224c6fE0a', '$TOKEN': 'eth', '$LICENSE': 'CA.05.19.21., Patent No. US 10,380,702', '$CONTRACTSHAHASH': '5085a00871feb30ffc3f1380578d1ccb993c307400950b5f582b90e9b8222dba'}}
